import React from "react";
import { Button, Jumbotron } from "reactstrap";

const Booking = () => {
  return (
    <Jumbotron>
      <div style={{textAlign:'center'}}>
        <h1>Booking form</h1>
        <h3></h3>
        <Button color="success">Confirm</Button>
        <Button color="danger">Cancel</Button>
      </div>
    </Jumbotron>
  );
};

export default Booking;
